import {Link, useParams, NavLink} from 'react-router-dom'
function EventDetailPage(){
   
    return(
        <div>
            <p>EventDetailPage</p>
            <p>{params.id}</p>
            <p><NavLink to="edit">Edit</NavLink></p>
            <p><Link to="..">Back</Link></p>
        </div>
    )
    }
    export default EventDetailPage
